import React from "react";
import { BrowserRouter as Router, Route, Routes, Link } from "react-router-dom";
import VegetableDetection from "./VegetableDetection";
import PacketDetection from "./PacketDetection";
import GetForecasting from "./pages/GetForecasting";
import ChefChat from "./components/ChefChatBot/ChefChat"; // ✅ NEW IMPORT

function App() {
  return (
    <Router>
      <div>
        <nav style={navStyle}>
          <ul style={{ display: "flex", gap: "20px", listStyleType: "none" }}>
            <li><Link to="/vegetable-detection">Vegetable Detection</Link></li>
            <li><Link to="/packet-detection">Packet Detection</Link></li>
            <li><Link to="/get-forecasting">Get Forecasting</Link></li>
            <li><Link to="/chef-chat">Chef Chat</Link></li> {/* ✅ NEW NAV ITEM */}
          </ul>
        </nav>

        <Routes>
          <Route path="/vegetable-detection" element={<VegetableDetection />} />
          <Route path="/packet-detection" element={<PacketDetection />} />
          <Route path="/get-forecasting" element={<GetForecasting />} />
          <Route path="/chef-chat" element={<ChefChat />} /> {/* ✅ NEW ROUTE */}
        </Routes>
      </div>
    </Router>
  );
}

const navStyle = {
  backgroundColor: "#f0f0f0",
  padding: "10px",
  marginBottom: "20px",
};

export default App;
